import React from "react";
import "./Navbar.css"

function Navbar() {

  return (
    <div id="myMenu" className={"navbar-menu"}>
      <span><a data-menuanchor="secondPage" href="#secondPage">Second</a></span>
      <span><a data-menuanchor="thirdPage" href="#thirdPage">Third</a></span>
    </div>
    )
}

export default Navbar;
